import React, { useState, useEffect } from "react";
import { AgGridReact } from "ag-grid-react";
import "ag-grid-community/styles/ag-grid.css";
import "ag-grid-community/styles/ag-theme-alpine.css";
import axios from "axios";

const Home = () => {
    const [flights, setFlights] = useState([]);

    useEffect(() => {
        axios.get("http://localhost:5000/api/flights").then((response) => {
            setFlights(response.data);
        });
    }, []);

    const columnDefs = [
        { field: "flight_number", headerName: "Flight", sortable: true },
        { field: "departure", headerName: "Departure", sortable: true },
        { field: "arrival", headerName: "Arrival", sortable: true },
        { field: "status", headerName: "Status", sortable: true },
    ];

    return (
        <div className="ag-theme-alpine" style={{ height: 400, width: "80%", margin: "auto" }}>
            <AgGridReact rowData={flights} columnDefs={columnDefs} />
        </div>
    );
};

export default Home;
